class MainButton extends Component{
  constructor(props) {
    super(props);
    this.state = {
      name: 1,
      about: 2
    }
  }

  render(){
    return(

      <button className='buttons'>{this.state.name}</button>
    )
  }
}


class Buttons extends Component{
  render() {
    return(
      <div>
        <MainButton name='Home' />
        <MainButton name='About' />
        <MainButton name='Projects' />
      </div>
    )
  }
}




export default App;
